import React from 'react';
import ProductItem from "./ProductItem";

function ProductList({productItems, action}) {
    return (
        <>
            <h3>Shoes Store</h3>
            <div className="row">
                {
                    productItems.map((shoes) => {
                        return (
                            <ProductItem key={shoes.id} item={shoes} action={action} />
                        )
                    })
                }
            </div>
        </>
    );
}

export default ProductList;
